'''
给定一个字符串 s，你可以通过在字符串前面添加字符将其转换为回文串。找到并返回可以用这种方式转换的最短回文串。


示例 1：

输入：s = "aacecaaa"
输出："aaacecaaa"

示例 2：

输入：s = "abcd"
输出："dcbabcd"

提示：

0 <= s.length <= 5 * 104
s 仅由小写英文字母组成
'''
from leetcode.tools.time import printTime


class Solution:
    '''
    KMP
    '''
    @printTime()
    def shortestPalindrome(self, s: str) -> str:
        n = len(s)
        s1 = s[::-1]
        pmt = [0 for _ in range(n)]
        j = 0
        for i in range(1, n):
            while j >= 0 and s[i] != s[j]:
                j = pmt[j - 1] if j != 0 else -1
            j += 1
            pmt[i] = j
        j = 0
        for i in range(n):
            while j >= 0 and s1[i] != s[j]:
                j = pmt[j - 1] if j != 0 else -1
            j += 1
        ret = ''
        for i in range(n - 1, j - 1, -1):
            ret += s[i]
        ret += s
        return ret

s = ""
# s = "aabcd"
Solution().shortestPalindrome(s)